import React, { Component } from 'react';
import './App.css';
import { Button, Nav, Navbar, Table, Container } from 'react-bootstrap';

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      valores: [{ id: 0, nome: "Gabriel", cidade: "Maranguape", idade: 21 },
      { id: 1, nome: "TTTT", cidade: "Maranguape", idade: 22 },
      { id: 2, nome: "TTTT", cidade: "Maranguape", idade: 21 },
      { id: 3, nome: "TTTT", cidade: "Maranguape", idade: 22 },
      { id: 4, nome: "TTTT", cidade: "Maranguape", idade: 22 },
      { id: 5, nome: "TTTT", cidade: "Maranguape", idade: 21 },
      { id: 6, nome: "TTTT", cidade: "Maranguape", idade: 22 },
      { id: 7, nome: "TTTT", cidade: "Maranguape", idade: 22 },
      { id: 8, nome: "TTTT", cidade: "Maranguape", idade: 21 },
      { id: 9, nome: "TTTT", cidade: "Maranguape", idade: 22 },
      { id: 10, nome: "TTTT", cidade: "Maranguape", idade: 22 },
      { id: 11, nome: "TTTT", cidade: "Maranguape", idade: 22 }],


      indice: [1, 2],
      inicio: 0, fim: 10,
    }
  }

  eventoBtn = (opcao) => {
    if(opcao === "First"){
      this.setState({inicio:0,fim:10});
    }
    else if(opcao==="Last"){
      this.setState({inicio:(this.state.valores.length%10)*10,fim:this.state.valores.length});
    }
    else{

    }
  }
  render() {
    return (
      <div className="App">
        <Navbar bg="dark" variant="dark" expand="lg">
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#features">Features</Nav.Link>
            </Nav>
          </Navbar.Collapse>

        </Navbar>
        <br />
        <Container>
          <Table striped bordered hover>
            <thead>
              <tr>
                <th>ID</th>
                <th>NOME</th>
                <th>CIDADE</th>
                <th>IDADE</th>
              </tr>
            </thead>
            <tbody>
              {this.state.valores.filter(
                (valores) => valores.id >= this.state.inicio && valores.id < this.state.fim)
                .map((item, indice) =>
                  <tr key={indice}>
                    <td>{item.id}</td>
                    <td>{item.nome}</td>
                    <td>{item.cidade}</td>
                    <td>{item.idade}</td>
                  </tr>
                )}
            </tbody>

          </Table>
          < nav aria-label="Page navigation example">
            <ul className="pagination justify-content-end">
              <li className="page-item">
                <button className="page-link" onClick={() =>this.eventoBtn("First")}>First</button>
              </li>
              {this.state.indice.map((item, indice) =>
                <li className="page-item"><button className="page-link" onClick={() =>this.eventoBtn(item)}>{item}</button></li>
              )}
              <li className="page-item">
                <button className="page-link" onClick={() =>this.eventoBtn("Last")}>Last</button>
              </li>
            </ul>
          </nav>

        </Container>

        <Button variant="dark" onClick={() => this.eventoBtn()}>Dark</Button>
      </div >
    );
  }
}

export default App;
